package com.tonymacdonald1995.magicconchshell

import net.dv8tion.jda.api.entities.Icon
import java.util.Base64

class Pfp {
    companion object {
        private val pfpBytes: ByteArray = Base64.getDecoder().decode(
            ""
        )
        val pfp: Icon = Icon.from(pfpBytes, Icon.IconType.PNG)
    }
}